    setscart(true);
  };
  const hidecarthandler = () => {
    setscart(false);
  };
  return (
    <Cartprovider>
      {scart && <Cart carthandler={hidecarthandler} />}

      <Header carthandler={showcarthandler} />
      <Meal />
    </Cartprovider>
  );
}

export default App;
